import React, {Component} from "react";
import 'bootstrap/dist/css/bootstrap.min.css';
import Alert from 'react-bootstrap/Alert';
import { Form } from 'semantic-ui-react';
import Button from 'react-bootstrap/Button';
import './resources/Form.css'

class Breathing extends Component{

  saveAndContinue = (e) => {
      e.preventDefault()
      this.props.nextStep()
  }

  back  = (e) => {
    e.preventDefault();
    this.props.prevStep();
}

  render(){
      const { values } = this.props;
      return(
          <Form >
              <Alert variant='danger'> Om du har mycket svårt att andas ring 112. </Alert>

              <h1 className="ui centered">Har du nyligen fått andningsbesvär?</h1>
              <Form.Dropdown value={values.temperature} onChange={this.props.handleChange('temperature')}>
                <select >
                  <option value="no">Nej</option>
                  <option value="little">Ja, jag får andnöd vid lätt ansträngning men inte i vila</option>
                  <option value="average">Ja. Hostar ofta</option>
                  <option value="high">Ja. Hostar nästan hela tiden</option>
                </select>
              </Form.Dropdown>
            <Button onClick={this.back}>Back</Button>
            <Button onClick={this.saveAndContinue}>Save And Continue </Button>
          </Form>
      )
  }
}

export default Breathing;
